import React from "react";

const Landing = () => {
  return (
    <div className="container vh-100 d-flex flex-column justify-content-center align-items-center text-center">
      <h1 className="fw-bold">Welcome to Auction App</h1>
      <p className="lead w-75">
        An auction is a process of buying and selling goods or services by offering them up for bids, 
        taking bids, and selling to the highest bidder.
      </p>
    </div>
  );
};

export default Landing;
